// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Student {
    struct StudentRecord {
        uint256 id;
        string name;
        string email;
        string password; // New attribute
        string certificateHash; // New attribute
        string dateOfBirth; // New attribute
    }

    mapping(uint256 => StudentRecord) public students;
    uint256 public studentCount;

    event StudentAdded(uint256 id, string name, string email, string password, string certificateHash, string dateOfBirth);

    function addStudent(
        uint256 _id, 
        string memory _name, 
        string memory _email, 
        string memory _password, 
        string memory _certificateHash, 
        string memory _dateOfBirth
    ) public {
        studentCount++;
        students[_id] = StudentRecord(_id, _name, _email, _password, _certificateHash, _dateOfBirth);
        emit StudentAdded(_id, _name, _email, _password, _certificateHash, _dateOfBirth);
    }

    function getStudent(uint256 _id) public view returns (
        uint256, 
        string memory, 
        string memory, 
        string memory, 
        string memory, 
        string memory
    ) {
        StudentRecord memory student = students[_id];
        return (
            student.id, 
            student.name, 
            student.email, 
            student.password, 
            student.certificateHash, 
            student.dateOfBirth
        );
    }

    function getAllStudents() public view returns (StudentRecord[] memory) {
        StudentRecord[] memory allStudents = new StudentRecord[](studentCount);
        uint256 index = 0;

        for (uint256 i = 0; i < studentCount; i++) {
            if (students[i].id != 0) {
                allStudents[index] = students[i];
                index++;
            }
        }

        return allStudents;
    }
}
